import Button from "../../UI/Button/Button";
import classes from './JpopButton.module.css';

const JpopButton = () =>{
    return <Button
    key="jpop"
    id="jpop"
    name="J-pop"
    className={classes["jpop-button"]}
  />
}
export default JpopButton;
